<script>
let cork = document.getElementsByClassName('cork'); // targeting the paths in the svg with the class name of cork
console.log(cork);
for (let i in cork){
    if(cork[i].nodeName == 'path') // this stops the for loop from targeting the __proto__ item inside the object
    {
      cork[i].style.fill = 'red' // this sets the initial color of the cork paths to red
    }
}

for(let i in cork){
    if(cork[i].nodeName == 'path')
    {
	    cork[i].addEventListener('mouseover', function(){ // adds a mouseover event listener to each path with the class of cork
            for (let i in cork){
                if(cork[i].nodeName == 'path')
                {
                    cork[i].style.fill = 'yellow'; // when the mouse is over cork it lights up in yellow
                }
            }
	    });
    }
}
	
for(let i in cork){
    if(cork[i].nodeName == 'path')
    {
	    cork[i].addEventListener('mouseleave', function(){
            for (let i in cork){
                if(cork[i].nodeName == 'path')
                {
                    cork[i].style.fill = 'red'; // when the mouse leaves the cork paths the colours revert to red
                }
            }
	    });
    }
}
